(ns clj-studies.hacker-rank.second-contest.sherlock-and-the-valid-string)

;https://www.hackerrank.com/contests/fenixoyota/challenges/sherlock-and-valid-string
;Sherlock and the Valid String

(defn group-by-num-chars [s]
  (->> (frequencies s)
       (group-by (fn [[_ v]] v))))

(defn num-chars-qtty [m]
  (map count (vals m)))

(defn isValid [s]
  (let [num-chars (group-by-num-chars s)
        count-chars (num-chars-qtty num-chars)]
    (cond
          (= (count num-chars) 1) "YES"
          (> (count num-chars) 2) "NO"
          (>=  (count (filter #(>= % 2) count-chars)) 2) "NO"
          (and (> (Math/abs (apply - (keys num-chars))) 1)
               (or (> (count (get num-chars 1)) 1)
                   (not (contains? num-chars 1)))) "NO"
          :else "YES")))


